use std::collections::HashMap;

macro_rules! dict {
    ($($key:expr => $value:expr,)+) => { dict!($($key => $value),+) };
    ($($key:expr => $value:expr),*) => {
        {
            let mut dict = HashMap::new();
            $(dict.insert($key, to_f32($value));)*
            dict
        }
    };
}

